svg.script:
  // 
  // SVG 已经添加脚本功能，可以点击色块复制其色值。
  // 因为浏览器安全问题，除非是 HTML 内嵌的 SVG 才可以执行脚本交互功能，图片嵌入等方式不可以。
  // 为了执行 SVG 脚本交互，可以单独打开 SVG 图形文档，这样它就是单独在沙箱中执行。
  function copyColor(event) {
    target = event.target
    if (target instanceof SVGCircleElement) {
      let cn = target.nextElementSibling
      let hx = cn.nextElementSibling
      setClipboard(cn.textContent.trimLeft() + hx.textContent.trim())
      return setAnimation(target, hx.textContent.trim())
    }
    console.log({is: target instanceof SVGCircleElement, 
      target: event.target, src: event.srcElement})
  }
  function setAnimation(target, bgc){
    view = document.querySelector(location.hash || "#dark-theme")
    group = view.nextElementSibling
    let [viewx, viewy, vieww, viewh] = view.getAttribute("viewBox").split(" ").map(it=>+it)
    aniclick = document.getElementById("aniclick")
    rect = target.getClientRects()[0]
    rootview = document.getElementById('rootview')
    aniclick.setAttribute('cx', rect.x + 14 + viewx + rootview.scrollLeft)
    aniclick.setAttribute('cy', rect.y + 14 + viewy + rootview.scrollTop)
    console.log({rect, aniclick, viewx, viewy, vieww, viewh})
    // access ElementTimeControl interface
    ani = document.getElementById("mani")
    ani.beginElement()
    anib = group.querySelector(".maniboard")
    anib.setAttribute('from', anib.getAttribute("to"))
    anib.setAttribute('to', bgc)
    anib.beginElement()
  }
  function setClipboard(text) {
      var type = "text/plain";
      var blob = new Blob([text], { type });
      var data = [new ClipboardItem({ [type]: blob })];

      navigator.clipboard.write(data).then(
          function () {
          console.log("/* copy successful */")
          },
          function (evt) {
          console.log("/* copy failure */", evt)
          }
      );
  }

  themes = ["#dark-theme", "#light-theme", "#red-theme", "#yellow-theme", 
            "#green-theme", "#cyan-theme", "#blue-theme", "#violet-theme"]

  /**
   * pushState cause <view> and set viewBox unworking.
   **/
  window.onkeydown = (evt) =>
  {
    let current = themes.indexOf(location.hash)
    keyevent = evt
    if (['magic', "Space", "ArrowRight", "ArrowUp"].indexOf(evt.code) > 0) {
      let next = (current + 1) % themes.length
      location.href = themes[next]
      // history.pushState({key: evt.code}, "", themes[next])
      // window.onhashchange && window.onhashchange()
      evt.preventDefault()
    } else if (['magic', "ArrowLeft", "ArrowDown"].indexOf(evt.code) > 0) {
      let prev = (current - 1 + themes.length) % themes.length
      location.href = themes[prev]
      // history.pushState({key: evt.code}, "", themes[prev])
      // window.onhashchange && window.onhashchange()
      evt.preventDefault()
    }
  }

  window.onhashchange = () => 
  {
    svg = document.getElementById("rootview")
    hash = location.hash
    theme = themes.indexOf(hash)
    vbox = document.querySelector(hash).getAttribute("viewBox")
    svg.setAttribute('viewBox', vbox);
  }
  //
